    private static HashMap<Character,Integer> characterCollection = new HashMap<>();

    public static void getCounts()
    {
        for (char piece : jumbleOhBumble.toCharArray()) {
            if (characterCollection.containsKey(piece)) {
                characterCollection.put(piece, characterCollection.get(piece) + 1);
            } else {
                characterCollection.put(piece, 1);
            }
        }

        System.out.println(characterCollection);
    }
    
